import React from "react";
import './ProfilePage.module.css';

export default function ProfilePage() {
  return (
    <div className="pageWrapper">
      <div className="card">
        <h2>User Profile</h2>
        <p>This page will show your user account details, preferences, and upgrade options.</p>
      </div>
    </div>
  );
}
